        lightingShader.use();
        lightingShader.setVec3("objectColor2", 0.0f, 1.0f, 0.0f);
        lightingShader.setVec3("lightColor2", 1.0f, 1.0f, 1.0f);
        lightingShader.setVec3("lightPos", lightPos);
        
